import React from "react";
import Heading from "../../1-atoms/Heading";
import ButtonPrimary from "../../1-atoms/Buttons/Primary";
import classnames from "classnames";

interface ProtectNeNowProps {
  text: string;
}

const ProtectNeNow: React.FC<
  ProtectNeNowProps & React.AllHTMLAttributes<HTMLDivElement>
> = ({ text, ...props }) => {
  return (
    <section className={"pt-[29px] px-[19px] pb-[45px]"}>
      <Heading
        level={2}
        className={classnames(
          { "pt-[6px] pb-[8px]": size === "s" },

          "font-bold text-[26px] leading-[30px] tracking-[-0.44px] mb-[19px] text-center text-neonBlue"
        )}
      >
        <span className={"text-luckyPoint"}>Stop your</span>
        <br /> phone from <br />
        being spied on
      </Heading>
      {text && (
        <p
          className={
            "text-center text-luckyPoint opacity-70  text-[16px] leading-[20px] tracking-[-0.248889px] mb-[19px] "
          }
        >
          {text}
        </p>
      )}
      <ButtonPrimary>Protect me now</ButtonPrimary>
    </section>
  );
};

export default ProtectNeNow;
